To properly end a C program execution, you should use the `return` statement in the `main` function. The `return` statement allows you to exit the program and optionally return a value to the operating system. Here's an example of how to use it:

```c
#include <stdio.h>

int main() {
    // Your program code here

    // When you want to end the program, use the return statement
    return 0;
}
```

In the above code, the `return 0;` statement indicates that the program has executed successfully. The value `0` is a common convention, but you can also return other values to indicate different exit statuses.

If you want to return a non-zero value to indicate an error or abnormal termination, you can use a different value. For example:

```c
#include <stdio.h>

int main() {
    // Your program code here

    // If an error occurs, return a non-zero value
    return 1;
}
```

Remember that the `return` statement should be placed at the end of the `main` function. It is also a good practice to include a `return` statement in all other functions to ensure proper program termination.

Additionally, if you are using a specific compiler or development environment, there might be additional steps or considerations to properly end a C program execution. Make sure to refer to the documentation or resources specific to your setup.
